export default () => (
  <header>
    <nav>
      <h1>Killerpedia</h1>
      <span>Browse by</span>
      <ul>
        <li>Male killers</li>
        <li>Female</li>
        <li>Country</li>
      </ul>
      <style jsx>{`
        nav {
          max-width: 1400px;
          margin: 0 auto;
          display: flex;
          align-items: center;
          text-transform: uppercase;
        }

        ul {
          margin: 0;
          padding: 0;
          display: flex;
          list-style: none;
          justify-content: space-between;
          font-weight: 300;
          font-size: 1rem;
        }

        li {
          margin-right: 1rem;
        }

        span {
          margin-right: 1rem;
        }

        h1 {
          font-size: 2rem;
          margin: 4px 0;
          flex: 1;
        }
      `}</style>
    </nav>
  </header>
);
